import { FunctionComponent } from "react";

import FeatureCard from "../components/FeatureCard/FeatureCard";
import Header from "../components/Header/Header";
import Footer from "../components/Footer/Footer";
import dot from "../Assets/Icons/Rectangle 1.svg";
import google from "../Assets/Icons/pngwing 1.svg";
import app from "../Assets/Icons/pngwing 2.svg";
import headerImage from "../Assets/Images/header_image.png";

import {
  LandingDesktopRoot,
  Pngwing2Icon,
  AvailableOnAndroid,
  PersonalizedAndInteractive,
  UserFriendlyInterfaceFor,
  ImageWrapper,
  InfoWrapper,
  TextWrapper,
  IconWrapper,
} from "./style";
import FoundersPage from "../components/FoundersPage/FoundersPage";
import OurStoryPage from "../components/OurStoryPage/OurStoryPage";

const LandingDesktop: FunctionComponent = () => {
  return (
    <LandingDesktopRoot>
      <Header />
      <InfoWrapper>
        <TextWrapper>
          <AvailableOnAndroid>
            <img src={dot} alt="dot" style={{ paddingRight: "3px" }} />
            Available on Android and iOS
          </AvailableOnAndroid>
          <PersonalizedAndInteractive>
            Personalized and interactive travel experiences based on your
            interest.
          </PersonalizedAndInteractive>
          <UserFriendlyInterfaceFor>{`User-friendly interface for easy navigation and access to information.  Text-to-speech technology allows users to get descriptions of nearby places without resorting to a map or guidebook. `}</UserFriendlyInterfaceFor>
          <IconWrapper>
            <img alt="" src={google} />
            <Pngwing2Icon alt="" src={app} />
          </IconWrapper>
        </TextWrapper>
        <ImageWrapper>
          <img
            src={headerImage}
            alt="image"
            style={{
              width: "100%",
              maxWidth: "800px",
              minWidth: "400px",
              paddingBottom: "50px",
            }}
          />
        </ImageWrapper>
      </InfoWrapper>
      <FeatureCard />
      <FoundersPage />
      <OurStoryPage />
      <Footer />
    </LandingDesktopRoot>
  );
};

export default LandingDesktop;
